import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./Component/Login";
import Register from "./Component/Register";
import Home from "./Component/Store/Home";
import Shop from "./Component/Store/Shop";
import "./Asset/app.css";

//admin dashboard
import Admin from "./Component/Admin/Admin";
import Product from "./Component/Admin/Admin-Products/Product";

//tailwindcss

import "./index.css";

//css from theme

import "./Asset/css/style.css";
import "./Asset/css/elegant-icons.css";
import "./Asset/css/customs.css";
/*

import "./Asset/css/font-awesome.min.css";
import "./Asset/css/magnific-popup.css";
import "./Asset/css/nice-select.css";

import "./Asset/css/slicknav.min.css";

*/
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/admin" element={<Admin />} />
        <Route path="/shop" element={<Shop />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
